INSERT INTO `bbstopic` VALUES ('30', '版本更新发布', '版本更新发布', '<p style=\"box-sizing:inherit;margin-top:0px;margin-bottom:16px;padding-bottom:15px;font-size:16px;white-space:normal;background-color:#F8F8F8;-webkit-tap-highlight-color:transparent;color:#3D464D;font-family:&quot;\">\n	1、修订用户登录后跳转<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n2、修订审批请假，天数不能输入小数问题<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n3、增加考勤管理<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;1、增加上下班考勤打卡<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;2、个人考勤列表、小计、搜索<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;3、全部员工考勤列表，小计<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;4、员工管理添加个人考勤快捷链接<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n4、增加消息通知功能<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;1、消息顶部红点显示<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;2、消息列表展示与删除<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;3、添加审批消息通知，审核通知<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;4、添加知识评论和赞通知<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n&nbsp; &nbsp;5、添加相册评论和赞通知\n</p>\n<p style=\"box-sizing:inherit;margin-top:0px;margin-bottom:16px;padding-bottom:15px;font-size:16px;white-space:normal;background-color:#F8F8F8;-webkit-tap-highlight-color:transparent;color:#3D464D;font-family:&quot;\">\n	5、增加公告删除功能<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n6、增加简历删除功能<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n7、优化表格抬头样式<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n8、初始化用户权限\n</p>\n<p style=\"box-sizing:inherit;margin-top:0px;margin-bottom:16px;padding-bottom:15px;font-size:16px;white-space:normal;background-color:#F8F8F8;-webkit-tap-highlight-color:transparent;color:#3D464D;font-family:&quot;\">\n	9、员工权限管理增加考勤设置、公告删除设置、简历删除设置<br style=\"box-sizing:inherit;-webkit-tap-highlight-color:transparent;\" />\n10、优化用户退出\n</p>', '140', '2018-01-30 20:53:04', '2', '1', '4', 'knowledge');
